sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.status_code != '200') {
    outputs.status = "Error";
    outputs.error_message = new BambooErrorHandler().setError(inputs.status_code, inputs.response_body);
  } else {
    outputs.status = "Success";
    var responseObj = JSON.parse(inputs.response_body);
    outputs.build_number = responseObj.buildNumber;
    outputs.build_result_key = responseObj.buildResultKey;
    outputs.build_trigger_reason = responseObj.triggerReason;
  }

})(inputs, outputs);

